                        <input type="password" id="password" placeholder="Mot de passe"/><br/>
                        <input type="submit" id="submitSignUp" value="Connexion"/><br/>
                    </form>
                </div>
                <div className="interactions">
                    <span>Mot de passe oubli√© ? Cliquez-ici</span>
                </div>
            </section>
        )
    }
}

